  @Test
  public void test_ComparePrecision() throws Exception {
    long nano = System.nanoTime();
    Geometry geom = new WKTReader().read(WKT);
    Coordinate[] coords = geom.getCoordinates();
    
    double east = Double.NEGATIVE_INFINITY;
    double west = Double.MAX_VALUE;
    double north = Double.NEGATIVE_INFINITY;
    double south = Double.MAX_VALUE;
    
    for (Coordinate coord: coords) {
      if (coord.y < west) {
        west = coord.y;
      }
      if (coord.y > east) {
        east = coord.y;
      }
      if (coord.x < south) {
        south = coord.x;
      }
      if (coord.x > north) {
        north = coord.x;
      }      
    }
    
    //long[] geocells = OutputStreamCoverage.toGeoCells(new FileInputStream("/var/tmp/tst-24.geoxp"));
    long[] geocells = GeoParser.parseArea(GEOXP.replace(" ", ""), -4).toGeoCells(32);
    long nanogeoxp;
    long nanojts;
    
    long total = 0;
    long geoxpout = 0;
    long geoxpin = 0;
    
        
    nano = System.nanoTime();
    boolean contains = false;
    for (int i = 0; i < 1000000; i++) {
      double lat = south + Math.random() * (north - south);
      double lon = west + Math.random() * (east - west);
      
      Geometry p = new WKTReader().read("POINT(" + lat + " " + lon + ")");
      long hhcode = HHCodeHelper.getHHCodeValue(lat, lon);
      total++;
      //System.out.println(geom.contains(p));
      //System.out.println(Coverage.contains(geocells, hhcode));
      boolean jts = geom.contains(p);
      boolean geoxp = Coverage.contains(geocells, hhcode);
      
      if (jts != geoxp) {
        if (geoxp) {
          geoxpin++;
        } else {
          geoxpout++;
        }
      }
      if (i % 1000 == 1) {
        System.out.print("*");
      }
    }
    System.out.println();
    nano = System.nanoTime() - nano;
    System.out.println(total + " " + (geoxpin+geoxpout) + " (" + geoxpin + " in/" + geoxpout + " out)");
    System.out.println(nano / 1000000.0);
  }
